import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Zoneterapi from './pages/Zoneterapi';
import Healing from './pages/Healing';
import Reaktion from './pages/Reaktion';
import Kontakt from './pages/Kontakt';
import Erfaringer from './pages/Erfaringer';  
import Priser from './pages/Priser';
import Booking from './pages/Booking';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" exact element={<Home/>} />
        <Route path="/zoneterapi" element={<Zoneterapi/>} />
        <Route path="/healing" element={<Healing/>} />
        <Route path="/reaktion" element={<Reaktion/>} />
        <Route path="/kontakt" element={<Kontakt/>} />
        <Route path="/erfaringer" element={<Erfaringer/>} />
        <Route path="/priser" element={<Priser/>} />
        <Route path="/booking" element={<Booking/>} />
      </Routes>
    </Router>
  );
}
export default App;

